            "Desc": {
                "CH": "在纯水精灵如今在枫丹已经绝迹的当下，水中出现的奇异元素生命体。\n在灾难后才出现的这种元素生灵不具备往昔纯水精灵的优美，因此被称为「浊水」。尽管溶解在水中的毒已经被稀释、净化，但除非何处仍有纯粹之水的容器，枫丹的水中再也不会自然地诞生纯水精灵了。",
                "EN": "Today, with the Oceanids extirpated from Fontaine, strange elemental life forms have appeared in the waters.\nThe elemental spirits that appeared after the calamity lack the elegance and beauty of the Oceanids, and thus have been called \"tainted.\" Though the toxins dissolved in the water have long since been diluted and cleansed, unless there are still containers of pure water somewhere, Fontaine's waters will never again naturally birth Oceanids."
            },
