            "Title": [
                {
                    "CH": "异界的生命组织",
                    "EN": "Otherworldly Agglomerated Organism"
                }
            ],
            "Desc": {
                "CH": "主要出现在厄里那斯的奇异生命体。\n在美露莘的认知里，隙境原体是基本上无害的生物，甚至有美露莘认为它十分可爱。\n美露莘的视觉感知与人有很大的区别。",
                "EN": "A strange life form that mostly appears in Elynas.\nMelusines perceive Breacher Primuses as harmless creatures, and many even find them completely adorable.\nThe visual perception of Melusines is very different from humans."
            },
            "Color": "Rock",
            "HP": 3.6,
            "HPCurve": 2,
            "ATK": 7.0,
            "ATKCurve": 4,
            "RESBase": {
                "Rock": 0.5
            },
            "Ball": {
                "Type": 7,
                "Point": 4,
                "Drop": "1113"
            },
            "Icon": [
                "UI_MonsterIcon_Ovacua_Order_01"
            ],
            "Grade": 2,
            "Weight": 150,
            "EndureTemplateID": 150,
            "Tutorial": {
                "CH": "- 以25~35s为间隔释放<b>终结技</b>：在6U岩元素增幅的加持下，释放持续20s的岩石压制攻击。期间不可打断且免疫风力牵引。<br>- 破除其岩元素增幅，或是使用<b>1次荒性或芒性</b>攻击，可以使其瘫痪15s。<br>- 元素增幅不会降低其受到的伤害。深渊特化版本入战立刻释放终结技。",
                "EN": "- Every 25~35s, performs <b>Ultimate</b>: Under the Enhancement of 6U Geo Element, unleash deadly Stonefall attacks, lasting 20s.<br>- Breaking the Geo Enhancement with reactions or attacking it <b>1 time with Pnuema or Ousia</b> will paralyze it for 15s.<br>- The Enhancement does not affect its DMG taken. Spiral Abyss Version uses Ultimate immediately after entering battle."
            },
