                "CH": "落草为寇的流浪武人，虽然常被称为「野伏」，但并不隶属于某个统一的团体。\n不仅掌握着精湛的剑术，还会使用具有元素的焰硝药粉攻击。从客观来说，或许这是背离武之道，转而寻求胜之途的体现吧。\n为了生计与财富，有时候甚至会与盗宝团、愚人众沆瀣一气。",
