                "CH": "落草为寇的流浪武人，虽然常被称为「野伏」，但并不隶属于某个统一的团体。\n除了作为武者必修的剑术之外，还会熟练地使用手弩偷袭对手，只要能够取胜便会不择手段。抛弃了武家之名的人，也常常会抛弃武家的自矜。\n为了生计与财富，有时候甚至会与盗宝团、愚人众沆瀣一气。",
