            "Title": [
                {
                    "CH": "因原海而进化的生命",
                    "EN": "Life Evolved by the Fontemer"
                }
            ],
            "Desc": {
                "CH": "通过发射水弹进行狩猎的水生动物。\n从演化的角度而言，原海异种是因为枫丹特殊的环境而产生了变化的水生动物。也因此可以认为在过去的某个时点前，枫丹原始的水生动物与提瓦特其他地区的水生动物并没有多少区别。",
                "EN": "An aquatic creature that hunts by firing watery projectiles.\nFrom an evolutionary perspective, it is assumed that Fontemer Aberrants have developed from aquatic creatures due to environmental factors specific to Fontaine. As such, it can be inferred that at some point in the past, Fontaine's original aquatic lifeforms differed little from those native to the other regions of Teyvat."
            },
