            "KingdomID": 6,
            "ClassID": 10616,
            "Name": {
                "CH": "坚盾重甲蟹",
                "EN": "Sternshield Crab"
            },
            "Title": [
                {
                    "CH": "因原海而进化的生命",
                    "EN": "Life Evolved by the Fontemer"
                }
            ],
            "Desc": {
                "CH": "寄居在螺与壳之中的螃蟹。\n重甲蟹会在成长的阶段中不断寻找适合自己体格的外壳。曾经有畅销的童话书，描述了重甲蟹寻找属于自己的住所的坎坷历程。那是充满了童趣的故事，但事后的反响证明了它与不少别的童话一样，为成年人带来的感触更深。",
                "EN": "A crab that makes its home in borrowed shells.\nArmored Crabs are constantly searching for shells that fit their bodies as they grow. A storybook that told the tale of the trials of an Armored Crab searching for a suitable shell was extremely popular in Fontaine for a time. Though the story is filled with childlike wonder, the reaction after proved that, like many fairytales, it touched adults even more deeply."
            },
