            "Desc": {
                "CH": "驮兽是人类的朋友。它们性格温顺，是重要的生产运输工具。\n在须弥，拥有驮兽的数量是财富的象征。大型的商队和镀金旅团往往拥有一支庞大的驮兽队伍，这使他们得以装载足够的补给与货物以跨越沙漠与丛林。\n驮兽能够适应各种不同的自然环境。早在雨林中的商贾注意到它们之前，这些勤劳的生灵便已是沙漠部族赖以生存的家畜。",
                "EN": "Sumpter Beasts are friends of humanity. These gentle-hearted creatures are indispensable elements of production and transportation.\nIn Sumeru, your wealth is symbolized by the number of Sumpter Beasts you own. Large merchant caravans and Eremites usually come with very sizable trains of Sumpter Beasts indeed, and this allows them to carry ample supplies and goods across both desert and forest alike.\nSumpter Beasts can adapt to various different natural environments. Long before the forest merchants ever noticed them, these hardworking animals were already the much-relied-upon domesticated beasts of the desert peoples."
            },
