            "ATKCurve": 3,
            "RESBase": {
                "Ice": 0.5,
                "Wind": 0.3
            },
            "Immune": [
                "Ice",
                "Wind"
            ],
            "Icon": [
                "and"
            ],
            "Grade": 4,
