                "EN": "Challenge the Aeonblight Drake (Heavy Assault Pack).\nIt appears no different from an Aeonblight Drake, but comes with even more dangerous weaponry that heretofore has only appeared in legends and a small number of reports. Now, it roams this mysterious Domain, directing its fearsome firepower against all it detects..."
